import React from "react";
import { Navbar, Nav, Container } from "react-bootstrap";

const HeaderNavigation = () => {
  return (
    <Navbar expand="lg" className="px-3 py-2" bg="light" variant="black" fixed="top">
      <Container>
        {/* Navbar Toggle for Mobile */}
        <Navbar.Toggle aria-controls="navbar-nav" />

        {/* Collapsible Nav Links */}
        <Navbar.Collapse id="navbar-nav" className="justify-content-space-evenly">
          {/* Brand Logo */}
        <Navbar.Brand href="#">
          <img
            src="https://dashboard.codeparrot.ai/api/image/Z7O5HTO_YEiK21yL/frame.png"
            alt="Checkers Logo"
            width="30"
            height="30"
            className="d-inline-block align-top"
          />
          <span className="ml-2 font-weight-bold">CHECKERS</span>
        </Navbar.Brand>
          <Nav className="text-center gap-4">
            <Nav.Link href="#">Как Работи</Nav.Link>
            <Nav.Link href="#">Услуги</Nav.Link>
            <Nav.Link href="#">За Нас</Nav.Link>
            <Nav.Link href="#">Запиши Се</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

export default HeaderNavigation;
